import React, { useState } from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';

const TeacherManagement = () => {
  const [showModal, setShowModal] = useState(false);

  const [email, setEmail] = useState('');
  const [memberName, setMemberName] = useState('');
  const [gender, setGender] = useState('');
  const [phoneNumber, setPhoneNumber] = useState('');
  const [address, setAddress] = useState('');
  const [detailAddress, setDetailAddress] = useState('');
  const [registrationNumber, setRegistrationNumber] = useState('');
  const [teachingLanguage, setTeachingLanguage] = useState('');
  const [bankName, setBankName] = useState('');
  const [accountNumber, setAccountNumber] = useState('');

  const toggleModal = () => {
    setShowModal(!showModal);
  };

  const handleSubmit = async () => {
    try {
      const formData = {
        email,
        memberName,
        phoneNumber,
        gender,
        address,
        detailAddress,
        registrationNumber,
        teachingLanguage,
        bankName,
        accountNumber,
      };
  
      const response = await axios.post('/TeacherCreate', formData);
      
      if (response.status === 201) {
        console.log('강사가 성공적으로 생성되었습니다.');
      }
  
      toggleModal(); // 모달 닫기
    } catch (error) {
      console.error('강사 생성에 실패했습니다.', error);
    }
  };
    return (
      <div className="container">
        <h1 className="mt-3 mb-3">강사 관리</h1>
        <div className="mb-3 d-flex justify-content-between">
          <div>
            <button className="btn btn-primary">재직 강사</button>
            <button className="btn btn-secondary ml-2">해직 강사</button>
            <button className="btn btn-secondary ml-2">전체 강사</button>
          </div>
          <button className="btn btn-success" onClick={toggleModal}>강사 생성</button>
        </div>
        {/* 모달 창 */}
        {showModal && (
        <div className="modal">
          <div className="modal-content">
            <span className="close" onClick={toggleModal}>&times;</span>
            <input type="text" placeholder="이메일" value={email} onChange={(e) => setEmail(e.target.value)} />
            <input type="text" placeholder="회원 이름" value={memberName} onChange={(e) => setMemberName(e.target.value)} />
            {/* 나머지 입력 항목들도 추가 */}
            <button onClick={handleSubmit}>저장</button>
          </div>
        </div>
      )}
      
        <table className="table">
          <thead>
            <tr>
              <th>강사번호</th>
              <th>이름</th>
              <th>이메일</th>
              <th>전화번호</th>
              <th>상세 정보</th>
              <th>강의 보기</th>
              <th>추가 수업 가능 시간</th>
              <th>수당 관리</th>
            </tr>
          </thead>
          <tbody>
            {/* 여기에 강사 정보를 루프로 돌려서 넣으면 돼 */}
          </tbody>
        </table>
        <button className="btn btn-info">더 보기</button>
      </div>
    );
  };

export default TeacherManagement;
